import React from 'react';
import { useParams } from 'react-router-dom';

const PetDetails = ({ location }) => {
  const { petId } = useParams();
  const petData = location.state && location.state.petData;

  if (!petData) {
    return <p>Error: Pet not found</p>;
  }

  return (
    <div>
      <h2>{petData.name}</h2>
      <p>Age: {petData.age}</p>
      <p>Gender: {petData.gender}</p>
      {/* Display other pet details here */}
    </div>
  );
};

export default PetDetails;
